import React from 'react';

function EventList({ events }) {
  return (
    <div className="event-list">
      <h2>Event List</h2>
      <ul>
        {events.map((event, index) => (
          <li key={index}>
            <strong>{event.eventName}</strong> - {event.eventDate}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default EventList;
